INSERT INTO layer (layer_id, fkey_wms_id, layer_pos, layer_parent, layer_name, layer_title, layer_queryable, layer_minscale, layer_maxscale, layer_dataurl, layer_metadataurl, layer_abstract) VALUES (10172, 640, 10, '0', 'daily_aqua', 'Daily composite of MODIS-AQUA images', 0, 250550, 0, '', '', ' 	Daily generated mosaic of the AQUA images released by the MODIS Rapid Response System. 	Updates every day, at about 1200Z, with images taken during the previous day. 	Maximum resolution is 8 arcseconds per pixel. The WMS "time" dimension can be used to retrieve past data.       ');
INSERT INTO layer (layer_id, fkey_wms_id, layer_pos, layer_parent, layer_name, layer_title, layer_queryable, layer_minscale, layer_maxscale, layer_dataurl, layer_metadataurl, layer_abstract) VALUES (19240, 640, 11, '0', 'BMNG', 'Blue Marble Next Generation, Global MODIS derived image', 0, 501099, 0, '', '', '         A set of twelve images built from MODIS data, one for each month of 2004. The native resolution is 15 arcseconds. This is the version with land and ocean bottom hillshading.       ');
