INSERT INTO layer (layer_id, fkey_wms_id, layer_pos, layer_parent, layer_name, layer_title, layer_queryable, layer_minscale, layer_maxscale, layer_dataurl, layer_metadataurl, layer_abstract) VALUES (7520, 584, 3, '0', 'CBC_PY', 'Canadian Christmas Bird Count Locations', 1, 0, 0, '', '', 'A winter survey of bird populations conducted during the Christmas period - December 14 to January 5th inclusive.  More than 1800 counts are conducted each year across Canada, the United States and Latin America.  On a selected day within the count period, local birders count as many birds as possible within a 24 km (15 mile) diameter circle.  The Christmas Bird Count had long been organized on the continental scale by the New York-based National Audubon Society. In 2000, Audubon finalized an agreement with Bird Studies Canada that would see BSC partner with Audubon to coordinate CBCs in Canada.  This layer represents the 24 km circles surveyed as part of each Christmas Bird Count conducted in Canada.  An accompanying layer (CBC_PT) contains the centre point of the circles.');
INSERT INTO layer (layer_id, fkey_wms_id, layer_pos, layer_parent, layer_name, layer_title, layer_queryable, layer_minscale, layer_maxscale, layer_dataurl, layer_metadataurl, layer_abstract) VALUES (7521, 584, 4, '0', 'MMP', 'Marsh Monitoring Program Route Locations', 1, 0, 0, '', '', 'A Spring survey of birds and amphibians carried out primarily within the Great Lakes region of North America.');
INSERT INTO layer (layer_id, fkey_wms_id, layer_pos, layer_parent, layer_name, layer_title, layer_queryable, layer_minscale, layer_maxscale, layer_dataurl, layer_metadataurl, layer_abstract) VALUES (7522, 584, 5, '0', 'CLLS', 'Canadian Lakes Loon Survey Locations', 1, 0, 0, '', '', 'A volunteer-based program that monitors the effects of acid rain and other human disturbance on loon breeding and presence on Canada''s cottage lakes and other waterbodies.');
