INSERT INTO layer (layer_id, fkey_wms_id, layer_pos, layer_parent, layer_name, layer_title, layer_queryable, layer_minscale, layer_maxscale, layer_dataurl, layer_metadataurl, layer_abstract) VALUES (19210, 787, 0, '', 'OGC-Dienst der Bayerischen Vermessungsverwaltung', 'OGC-Dienst der Bayerischen Vermessungsverwaltung', 0, 0, 0, '', '', 'Saemtliche Rechte an den ueber diesen Dienst verfuegbaren Geobasisdaten liegen beim Landesamt fuer Vermessung und Geoinformation (LVG Bayern). Fuer ihre Nutzung durch Vervielfaeltigung, Verbreitung und Veroeffentlichung beachten Sie bitte die Nutzungsbedingungen unter http://www.geodaten.bayern.de/ogc/Nutzungsbedingungen.htm. Kostenfrei gestattet ist die Vervielfaeltigung zum privaten Gebrauch sowie die Veroeffentlichung von Geobasisdaten auf der eigenen Website im Umfang eines Bildes von maximal 1024 x 768 Pixel. Die Quellenangabe ist in der Form "(c) LVG Bayern" anzubringen und als Link auf http://www.lvg.bayern.de auszufuehren. Fuer jede andere Nutzung ist eine Nutzungsvereinbarung mit dem LVG Bayern erforderlich.');
INSERT INTO layer (layer_id, fkey_wms_id, layer_pos, layer_parent, layer_name, layer_title, layer_queryable, layer_minscale, layer_maxscale, layer_dataurl, layer_metadataurl, layer_abstract) VALUES (10166, 640, 1, '0', 'global_mosaic', 'WMS Global Mosaic, pan sharpened', 0, 20044, 0, '', 'http://onearth.jpl.nasa.gov/WAF/WMS_GM.xml', ' 	Release 2 of the WMS Global Mosaic, a seamless mosaic of Landsat7 scenes. 	Spatial resolution is 0.5 second for the pan band, 1 second for the visual and near-IR bands and 2 second for the thermal bands 	Use this layer to request individual grayscale bands. The default styles may have gamma, sharpening and saturation filters applied. 	The grayscale styles have no extra processing applied, and will return the image data as stored on the server. 	The source dataset is part of the NASA Scientific Data Purchase, and contains scenes acquired in 1999-2003.         This layer provides pan-sharpened images, where the pan band is used for the image brightness regardless of the color combination requested.       ');
