INSERT INTO layer (layer_id, fkey_wms_id, layer_pos, layer_parent, layer_name, layer_title, layer_queryable, layer_minscale, layer_maxscale, layer_dataurl, layer_metadataurl, layer_abstract) VALUES (19229, 640, 4, '0', 'srtm_mag', 'SRTM reflectance magnitude, 30m', 0, 20044, 0, '', '', '   This is the radar reflectance image produced by the SRTM mission. It is the best available snapshot of the surface of the earth, being the highest resolution image collected in the shortest ammount of time, with near-global 30m coverage collected during an 11-day Endeavour mission, in February of 2000. Five basic bands are available as WMS styles, ss1, ss2, ss3 and ss4 being SRTM image subswath averages, the "all" style being an average of the four subswath composites. The "default" style is derived from the "all" band, using an arbitrary color map to make more detail visible. The subswath composites also available as WMS bands, band 0 correspoinding to ss1, 1 to "ss2", 2 to "ss3", 3 to "ss4" and 5 to "all". A radar image has little in common with a visual image, depending mostly on the material and orientation of the object. Areas with low detail such as lakes and sand tend to have no reflection, and very steep terrain can obscure certain areas from the side look ing SRTM instrument, both fenomena generating voids in the SRTM reflectance image. Urban areas tend to have stronger reflectance. The banding artifacts still visible in the images are the result of the combination of data from multiple orbits or are intrinsic to the SRTM instrument.       ');
INSERT INTO layer (layer_id, fkey_wms_id, layer_pos, layer_parent, layer_name, layer_title, layer_queryable, layer_minscale, layer_maxscale, layer_dataurl, layer_metadataurl, layer_abstract) VALUES (19230, 640, 5, '0', 'daily_terra_721', 'Daily composite of MODIS-TERRA 721 pseudocolor', 0, 250550, 0, '', '', ' 	Daily generated mosaic of TERRA images released by the MODIS Rapid Response System. 	Updates every day, at about 1200Z, with images taken during the previous day. 	Maximum resolution is 8 arcseconds per pixel. The WMS "time" dimension can be used to retrieve past data.         The 721 band mapping is used to identify burnt and flooded areas.       ');
INSERT INTO layer (layer_id, fkey_wms_id, layer_pos, layer_parent, layer_name, layer_title, layer_queryable, layer_minscale, layer_maxscale, layer_dataurl, layer_metadataurl, layer_abstract) VALUES (19231, 640, 6, '0', 'daily_aqua_721', 'Daily composite of MODIS-AQUA 721 pseudocolor', 0, 250550, 0, '', '', ' 	Daily generated mosaic of the AQUA images released by the MODIS Rapid Response System. 	Updates every day, at about 1200Z, with images taken during the previous day. 	Maximum resolution is 8 arcseconds per pixel. The WMS "time" dimension can be used to retrieve past data.         The 721 band mapping is used to identify burnt and flooded areas.       ');
INSERT INTO layer (layer_id, fkey_wms_id, layer_pos, layer_parent, layer_name, layer_title, layer_queryable, layer_minscale, layer_maxscale, layer_dataurl, layer_metadataurl, layer_abstract) VALUES (19232, 640, 7, '0', 'daily_terra_ndvi', 'Daily composite of MODIS-TERRA images, NDVI processing', 0, 250550, 0, '', '', ' 	Daily generated mosaic of TERRA images released by the MODIS Rapid Response System. 	Updates every day, at about 1200Z, with images taken during the previous day. 	Maximum resolution is 8 arcseconds per pixel. The WMS "time" dimension can be used to retrieve past data.         The Normalized Difference Vegetation Index (NDVI) is strongly correlated with the plant density and state.       ');
INSERT INTO layer (layer_id, fkey_wms_id, layer_pos, layer_parent, layer_name, layer_title, layer_queryable, layer_minscale, layer_maxscale, layer_dataurl, layer_metadataurl, layer_abstract) VALUES (19234, 640, 8, '0', 'daily_aqua_ndvi', 'Daily composite of MODIS-AQUA images, NDVI processing', 0, 250550, 0, '', '', ' 	Daily generated mosaic of the AQUA images released by the MODIS Rapid Response System. 	Updates every day, at about 1200Z, with images taken during the previous day. 	Maximum resolution is 8 arcseconds per pixel. The WMS "time" dimension can be used to retrieve past data.         The Normalized Difference Vegetation Index (NDVI) is strongly correlated with the plant density and state.       ');
