INSERT INTO layer (layer_id, fkey_wms_id, layer_pos, layer_parent, layer_name, layer_title, layer_queryable, layer_minscale, layer_maxscale, layer_dataurl, layer_metadataurl, layer_abstract) VALUES (10424, 655, 11, '0', 'oi_sst', 'Optimally Interpolated SST, courtesy USF Ocean Circulation Group (http://ocg6.marine.usf.edu/)', 0, 0, 0, '', '', 'This layer is an operational, cloud-free, satellite SST product for the SEACOOS domain. Using Optimal Interpolation (OI) three types of satellite sea surface temperature (SST) data are merged to produce a cloud-free satellite SST field. Input data come from NOAA and NASA satellites and are compiled and processed daily by the USF Ocean Circulation Group, http://ocg6.marine.usf.edu. DISPLAY NOTE : A land mask cover should be placed over this layer.');
INSERT INTO layer (layer_id, fkey_wms_id, layer_pos, layer_parent, layer_name, layer_title, layer_queryable, layer_minscale, layer_maxscale, layer_dataurl, layer_metadataurl, layer_abstract) VALUES (10425, 655, 12, '0', 'modis_sst', 'MODIS SST, courtesy USF Institute for Marine Remote Sensing (http://imars.usf.edu/)', 0, 0, 0, '', '', 'This SST layer is estimated from infrared measurements collected by the Advanced Very High Resolution Radiometer aboard NOAA''s series of polar orbiting satellites. Energy levels at the top of the atmosphere in the 10 - 11 micron range are fit statistically to in-water SST measurements to allow 1km resolution SST estimates to be made. These data are made available by the USF Institute for Marine Remote Sensing, http://imars.usf.edu. DISPLAY NOTE : A land mask cover should be placed over this layer.');
INSERT INTO layer (layer_id, fkey_wms_id, layer_pos, layer_parent, layer_name, layer_title, layer_queryable, layer_minscale, layer_maxscale, layer_dataurl, layer_metadataurl, layer_abstract) VALUES (19260, 840, 0, '', 'World', 'World', 0, 0, 0, '', '', '');
INSERT INTO layer (layer_id, fkey_wms_id, layer_pos, layer_parent, layer_name, layer_title, layer_queryable, layer_minscale, layer_maxscale, layer_dataurl, layer_metadataurl, layer_abstract) VALUES (10426, 655, 13, '0', 'avhrr_sst', 'AVHRR SST, courtesy USF Institute for Marine Remote Sensing (http://imars.usf.edu/)', 0, 0, 0, '', '', 'This SST layer is derived from infrared measurements collected by the MODerate Resolution Imaging Spectroradiometers aboard NASA''s polar orbiting Terra and Aqua satellites. Energy levels at the top of the atmosphere in the 10-11 micron range (daytime) and 3-4 micron range (nighttime) are fit statistically to in-water SST measurements to allow 1km resolution SST estimates to be made. The resolution and accuracy of MODIS data are among the best available to Earth scientists today. These data are made available by the USF Institute for Marine Remote Sensing, http://imars.usf.edu.  DISPLAY NOTE : A land mask cover should be placed over this layer.');
