	Daily generated mosaic of the AQUA images released by the MODIS Rapid Response System.
	Updates every day, at about 1200Z, with images taken during the previous day.
	Maximum resolution is 8 arcseconds per pixel. The WMS "time" dimension can be used to retrieve past data.
        The Normalized Difference Vegetation Index (NDVI) is strongly correlated with the plant density and state.
      </Abstract>
      <LatLonBoundingBox minx="-180" miny="-90" maxx="180" maxy="90" />
      <Dimension name="time" units="ISO8601" default="2006-12-19">2006-01-01/2006-12-19/P1D</Dimension>
      <Style> <Name>default</Name> <Title>visual</Title> </Style>
      <ScaleHint min="125" max="10000"/>
    </Layer>

    <Layer queryable="0">
      <Name>daily_terra</Name>
      <Title>Daily composite of MODIS-TERRA images</Title>
      <Abstract>
	Daily generated mosaic of TERRA images released by the MODIS Rapid Response System.
