      <Dimension name="time" units="ISO8601" default="2006-12-19">2004-12-24/2006-12-19/P1D</Dimension>
      <Style>
        <Name>default</Name>
	<Title>visual</Title>
      </Style>
      <ScaleHint min="125" max="10000" />
    </Layer>

    <Layer queryable="0">
      <Name>daily_aqua</Name>
      <Title>Daily composite of MODIS-AQUA images</Title>
      <Abstract>
	Daily generated mosaic of the AQUA images released by the MODIS Rapid Response System.
	Updates every day, at about 1200Z, with images taken during the previous day.
