    <Layer queryable="0">
      <Name>BMNG</Name>
      <Title>Blue Marble Next Generation, Global MODIS derived image</Title>
      <Abstract>
        A set of twelve images built from MODIS data, one for each month of 2004. The native resolution is 15 arcseconds. This is the version with land and ocean bottom hillshading.
      </Abstract>
	<LatLonBoundingBox minx="-180" miny="-90" maxx="180" maxy="90" />
	<Style><Name>default</Name><Title>October</Title></Style>
	<Style><Name>Jan</Name><Title>January</Title></Style>
