 digitized and georeferenced to Delaware State Plane NAD83 meters. This data is available as an ArcIMS map service, a WMS map service, original 1-meter raw data files. </Abstract><KeywordList><Keyword>Delaware</Keyword><Keyword>DataMIL</Keyword><Keyword>The National Map</Keyword><Keyword>framework</Keyword><Keyword>orthoimagery</Keyword><Keyword>orthophotography</Keyword><Keyword>aerial imagery</Keyword><Keyword>imagery</Keyword></KeywordList><OnlineResource xmlns:xlink="http://www.w3.org/1999/xlink" xlink:href="http://datamil.delaware.gov:80/wmsconnector/com.esri.wms.Esrimap/DE_aerial02?" xlink:type="simple"/><ContactInformation><ContactPersonPrimary><ContactPerson>William S. Schenck</ContactPerson><ContactOrganization>Delaware Geological Survey</ContactOrganization></ContactPersonPrimary><ContactPosition>Scientist</ContactPosition><ContactAddress><AddressType>postal</AddressType><Address>DGS Building</Address><City>Newark</City><StateOrProvince>Delaware</StateOrProvince><PostCode>19716-7501</PostCode><Country>USA</Country></ContactAddress><ContactVoiceTelephone>1-302-831-8262</ContactVoiceTelephone><ContactFacsimileTelephone>1-302-831-3579</ContactFacsimileTelephone><ContactElectronicMailAddress>rockman@udel.edu</ContactElectronicMailAddress></ContactInformation><Fees>none</Fees><AccessConstraints>none</AccessConstraints></Service><Capability><Request><GetCapabilities><Format>application/vnd.ogc.wms_xml</Format><DCPType><HTTP><Get><OnlineResource xmlns:xlink="http://www.w3.org/1999/xlink" xlink:href="http://datamil.delaware.gov:80/wmsconnector/com.esri.wms.Esrimap/DE_aerial02?" xlink:type="simple"/></Get></HTTP></DCPType></GetCapabilities><GetMap><Format>image/png</Format><Format>image/jpeg</Format><Format>image/gif</Format><DCPType><HTTP><Get><OnlineResource xmlns:xlink="http://www.w3.org/1999/xlink" xlink:href="http://datamil.delaware.gov:80/wmsconnector/com.esri.wms.Esrimap/DE_aerial02?" xlink:type="simple"/></Get></HTTP></DCPType></GetMap><GetFeatureInfo><Format>application/vnd.ogc.wms_xml</Format><Format>text/xml</Format><Format>text/html</Format><Format>text/plain</Format><DCPType><HTTP><Get><OnlineResource xmlns:xlink="http://www.w3.org/1999/xlink" xlink:href="http://datamil.delaware.gov:80/wmsconnector/com.esri.wms.Esrimap/DE_aerial02?" xlink:type="simple"/></Get></HTTP></DCPType></GetFeatureInfo></Request><Exception><Format>application/vnd.ogc.se_xml</Format><Format>application/vnd.ogc.se_inimage</Format><Format>application/vnd.ogc.se_blank</Format></Exception><Layer queryable="0" opaque="0" noSubsets="0"><Title>DE_aerial02</Title><SRS>EPSG:4326</SRS><SRS>EPSG:102257</SRS><SRS>EPSG:4267</SRS><SRS>EPSG:4269</SRS><SRS>EPSG:4152</SRS><SRS>EPSG:26757</SRS><SRS>EPSG:26718</SRS><SRS>EPSG:26957</SRS><SRS>EPSG:2235</SRS><SRS>EPSG:102657</SRS><SRS>EPSG:2776</SRS><SRS>EPSG:102277 </SRS><SRS>EPSG:2880</SRS><SRS>EPSG:102211</SRS><SRS>EPSG:32618</SRS><LatLonBoundingBox minx="-75.8848418733" miny="38.3741058346" maxx="-74.9910506181" maxy="39.8751126213"/><BoundingBox SRS="EPSG:102257" minx="166499.875" miny="50000.125" maxx="232799.875" maxy="204700.125"/><Layer queryable="0"><Name>ortho2002</Name><Title>2002 Aerial Imagery</Title><SRS>EPSG:4326</SRS><LatLonBoundingBox minx="-75.8080759734" miny="38.449822323" maxx="-75.0334387781" maxy="39.8432887294"/><BoundingBox SRS="EPSG:102257" minx="166499.874927962" miny="50000.1249279622" maxx="321199.874927962" maxy="204700.124927962" /> </Layer></Layer></Capability></WMT_MS_Capabilities>', NULL, 'http://datamil.delaware.gov:80/wmsconnector/com.esri.wms.Esrimap/DE_aerial02?REQUEST=GetCapabilities&SERVICE=WMS&VERSION=1.1.1', 'none', 'none', 'William S. Schenck', 'Scientist', 'Delaware Geological Survey', 'DGS Building', 'Newark', 'Delaware', '19716-7501', 'USA', '1-302-831-8262', '1-302-831-3579', 'rockman@udel.edu', NULL, 1, 1173698126, NULL, NULL, NULL, NULL);
