<!-- The DTD (Document Type Definition) given here must correspond to the version number declared in the WMT_MS_Capabilities element below. -->
<!DOCTYPE WMT_MS_Capabilities SYSTEM "http://maps.customweather.com/wms/1.1.1/WMS_MS_Capabilities.dtd" [
  <!-- Vendor-specific elements are defined here if needed. 
  If not needed, just leave this EMPTY declaration.  Do not
  delete the declaration entirely.--> 
 <!ELEMENT VendorSpecificCapabilities EMPTY>
 ]><!-- end of DOCTYPE declaration -->

<!-- The version number listed in the WMT_MS_Capabilities element here must
correspond to the DTD declared above.  See the WMT specification document for
how to respond when a client requests a version number not implemented by the
server. -->
<WMT_MS_Capabilities version="1.1.1">
<!-- Service Metadata -->
<Service>
  <!-- The WMT-defined name for this type of service -->
  <Name>OGC:WMS</Name>
  <!-- Human-readable title for pick lists -->
  <Title>CustomWeather Map Server</Title>
  <!-- Narrative description providing additional information -->
  <Abstract>CustomWeather WMS Map Server.  Contact: info@customweather.com.</Abstract>
  <KeywordList>
    <Keyword>Weather Maps</Keyword>
  </KeywordList>
  <!-- Top-level web address of service or service provider.  See also OnlineResource
  elements under <DCPType>. -->
  <OnlineResource xmlns:xlink="http://www.w3.org/1999/xlink" xlink:type="simple" xlink:href="http://www.customweather.com/?"/>
  <!-- Contact information -->
  <ContactInformation>
    <ContactPersonPrimary>
      <ContactPerson>Geoff Flint</ContactPerson>
      <ContactOrganization>CustomWeather</ContactOrganization>
    </ContactPersonPrimary>
    <ContactPosition>President, CEO</ContactPosition>
    <ContactAddress>
      <AddressType>postal</AddressType>
      <Address>230 California Street, Suite 420</Address>
      <City>San Francisco</City>
      <StateOrProvince>CA</StateOrProvince>
      <PostCode>94111</PostCode>
      <Country>USA</Country>
    </ContactAddress>
    <ContactVoiceTelephone>+1 415 777-3303</ContactVoiceTelephone>
    <ContactFacsimileTelephone>+1 415 777-3003</ContactFacsimileTelephone>
    <ContactElectronicMailAddress>gflint@customweather.com</ContactElectronicMailAddress>
  </ContactInformation>
  <!-- Fees or access constraints imposed. -->
  <Fees>contact for more info</Fees>
  <AccessConstraints>contact for more info</AccessConstraints>
</Service>

<Capability>
  <Request>
    <GetCapabilities>
      <Format>application/vnd.ogc.wms_xml</Format>
      <DCPType>
        <HTTP>
          <Get>
            <!-- The URL here for invoking GetCapabilities using HTTP GET
            is only a prefix to which a query string is appended. -->
            <OnlineResource xmlns:xlink="http://www.w3.org/1999/xlink" xlink:type="simple" xlink:href="http://maps.customweather.com/image?"/>
          </Get>
          <Post>
            <!-- The URL here for invoking GetCapabilities using HTTP POST
            includes the complete address to which a query would be sent in
            XML format.  This is here for future expansion; no POST encoding
	    has yet been defined. -->
            <OnlineResource xmlns:xlink="http://www.w3.org/1999/xlink" xlink:type="simple" xlink:href="http://maps.customweather.com/image?"/>
          </Post>
        </HTTP>
      </DCPType>
    </GetCapabilities>

    <GetMap>
      <Format>image/gif</Format>
      <Format>image/png</Format>
      <Format>image/jpeg</Format>
      <Format>image/tiff</Format>
      <DCPType>
        <HTTP>
          <Get>
            <!-- The URL here for invoking GetCapabilities using HTTP GET
            is only a prefix to which a query string is appended. -->
            <OnlineResource xmlns:xlink="http://www.w3.org/1999/xlink" xlink:type="simple" xlink:href="http://maps.customweather.com/image?"/>
          </Get>
        </HTTP>
      </DCPType>
    </GetMap>
    <GetFeatureInfo>
      <Format>application/vnd.ogc.gml</Format>
      <Format>text/plain</Format>
      <Format>text/html</Format>
      <DCPType>
        <HTTP>
          <Get>
            <OnlineResource xmlns:xlink="http://www.w3.org/1999/xlink" xlink:type="simple" xlink:href="http://maps.customweather.com/image?"/>
          </Get>
        </HTTP>
      </DCPType>
    </GetFeatureInfo>
  </Request>

  <Exception>
    <Format>application/vnd.ogc.se_xml</Format>
  </Exception>

  <!-- Any text or markup is allowed here, as required to describe
       vendor-specific capabilities.  Please define elements and attributes
       in the DOCTYPE declaration at the start of the document. -->

  <!-- Place-holder for Styled Layer Descriptor (SLD)-enabled WMSes.
       This element is absent for a basic WMS. -->

  <UserDefinedSymbolization SupportSLD="1" UserLayer="1" UserStyle="1" RemoteWFS="1"/>

